import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Home from './pages/home';
import Busca from "./pages/busca";
import Perfil from "./pages/perfil";
import Pedidos from "./pages/pedidos";
import Login from "./pages/login";
import Cadastro from "./pages/cadastro";
import PrivateRoute from "./components/private-route";
import Clientes from './pages/clientes/clientes';
import Dispositivos from './pages/dispositivos/dispositivos';
import Backup from './pages/backup/backup';
import Arquivos from './pages/arquivos/arquivos';

function Rotas(){
    return <>
        
        <BrowserRouter>
            <Routes>
                <Route exact path="/" element={<Home />} />
                <Route exact path="/clientes" element={<PrivateRoute><Clientes /></PrivateRoute>} />
                <Route exact path="/dispositivos" element={<Dispositivos />} />
                <Route exact path="/backup" element={<Backup />} />
                <Route exact path="/backup/:id" element={<Arquivos />} />
                <Route exact path="/login" element={<Login />} />
                <Route exact path="/cadastro" element={<Cadastro />} />
            </Routes>
        </BrowserRouter>
    </>
}

export default Rotas;
